package com.example.dodo.geologistica;public class Tecnico {    private int idtecnico;    private String nomeTecnico;    private int area;    public int getIdtecnico() {        return idtecnico;    }    public void setIdtecnico(int idtecnico) {        this.idtecnico = idtecnico;    }    public String getNomeTecnico() {        return nomeTecnico;    }    public void setNomeTecnico(String nomeTecnico) {        this.nomeTecnico = nomeTecnico;    }    public int getArea() {        return area;    }    public void setArea(int area) {        this.area = area;    }}